(1, 'ADATA HV100 External Hard Drive', 'HV100', 'adata-hv100-external-hard-drive-1', 10, 1, 32, 'ADATA', 'BLACKBLUEWHITE', 'Great extra storage and fingerprint resistant', '<ul>\n<li><strong>Matte-textured: tough and smudge-free</strong></li>\n<li><strong>G-Shock sensor data protection</strong></li>\n<li><strong>USB 3.0 interface, up to 10X faster than USB 2.0!</strong></li>\n<li><strong>Clear LED activity indicator</strong></li>\n<li><strong>Capacity 500GB / 1TB / 2TB</strong></li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-09-20 10:53:36', '2016-11-21 16:40:06', 2, 1),
(2, 'ADATA HV620 External Hard Drive', 'HV620', 'adata-hv620-external-hard-drive-2', 10, 1, 32, 'ADATA', 'WHITEBLACK', 'Stylish Sleek Serious', '<ul>\n<li><strong>Scratch-resistant design</strong></li>\n<li><strong>Sleek and glossy look</strong></li>\n<li><strong>Clear LED activity indicator</strong></li>\n<li><strong>USB 3.0 interface, up to 10X faster than USB 2.0!</strong></li>\n<li><strong>Capacity 500GB / 1TB / 2TB</strong></li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-09-20 10:53:36', '2016-11-21 16:40:45', 2, 1),
(3, 'ADATA HD710A For Mac Ext. HDD', 'HD710A', 'adata-hd710a-for-mac-ext-hdd-3', 10, 1, 32, 'ADATA', 'WHITE', 'More durable than ever - exclusively for Mac', '<ul>\n<li><strong>MIL-STD-810 516.6 military-spec shock resistance</strong></li>\n<li><strong>G-Shock sensor data protection</strong></li>\n<li><strong>USB 3.0 interface, up to 10X faster than USB 2.0!</strong></li>\n<li><strong>IP68-certified water and dust resistance</strong></li>\n<li><strong>Convenient wrap-around cable</strong></li>\n<li><strong>Capacity 1TB / 2TB</strong></li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-09-20 10:53:36', '2016-11-21 16:40:38', 2, 1),
(4, 'ADATA HD710 External Hard Drive', 'HD710', 'adata-hd710-external-hard-drive-4', 10, 1, 32, 'ADATA', 'YELLOWBLACKBLUE', 'Perfect fit for road warriors', '<ul>\n<li><strong>MIL-STD-810 516.6 military-spec shock resistance</strong></li>\n<li><strong>IP68-certified water and dust resistance</strong></li>\n<li><strong>USB 3.0 interface, up to 10X faster than USB 2.0!</strong></li>\n<li><strong>Convenient wrap-around cable</strong></li>\n<li><strong>Capacity 500GB / 1TB / 2TB</strong></li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-09-20 10:53:36', '2016-12-27 13:49:02', 2, 1),
