(6, 'ADATA HD650 External Hard Drive', 'HD650', 'adata-hd650-external-hard-drive-6', 10, 1, 32, 'ADATA', 'BLACKRED', 'Life is an adventure IP68-certified water and dust resistanc', '<ul>\n<li><strong>Designed to absorb harsh shocks</strong></li>\n<li><strong>Coated in durable silicone</strong></li>\n<li><strong>Protective surfaces throughout</strong></li>\n<li><strong>USB 3.0 interface, up to 10X faster than USB 2.0!</strong></li>\n<li><strong>Capacity 500GB / 1TB / 2TB</strong></li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-09-20 10:53:36', '2016-11-21 16:40:21', 2, 1),
