(1, 'ADATA HV100 External Hard Drive', 'HV100', 'adata-hv100-external-hard-drive-1', 10, 1, 468, 'ADATA', 'BLACKBLUEWHITE', 'Great extra storage and fingerprint resistant', '<ul>\n<li>Matte-textured: tough and smudge-free</li>\n<li>G-Shock sensor data protection</li>\n<li>USB 3.0 interface, up to 10X faster than USB 2.0!</li>\n<li>Clear LED activity indicator</li>\n<li>Capacity 500GB / 1TB / 2TB</li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-08-24 12:16:41', '2016-08-24 17:58:43', 2, 1),
(2, 'ADATA HV620 External Hard Drive', 'HV620', 'adata-hv620-external-hard-drive-2', 10, 1, 468, 'ADATA', 'WHITEBLACK', 'Stylish Sleek Serious', '<ul>\n<li>Scratch-resistant design</li>\n<li>Sleek and glossy look</li>\n<li>Clear LED activity indicator</li>\n<li>USB 3.0 interface, up to 10X faster than USB 2.0!</li>\n<li>Capacity 500GB / 1TB / 2TB</li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-08-24 12:16:41', '2016-08-24 17:52:20', 2, 1),
(3, 'ADATA HD710A For Mac Ext. HDD', 'HD710A', 'adata-hd710a-for-mac-ext-hdd-3', 10, 1, 468, 'ADATA', 'WHITE', 'More durable than ever - exclusively for Mac', '<ul>\n<li>MIL-STD-810 516.6 military-spec shock resistance</li>\n<li>G-Shock sensor data protection</li>\n<li>USB 3.0 interface, up to 10X faster than USB 2.0!</li>\n<li>IP68-certified water and dust resistance</li>\n<li>Convenient wrap-around cable</li>\n<li>Capacity 1TB / 2TB</li>\n</ul>', 'pc', 0, '', '5', '0.00', '0.00', '2016-08-24 12:16:41', '2016-08-24 17:51:53', 2, 1),
