(2, 10, '<ol>\n<li><em><strong>We deliver the products with in the Nehru Place with in 30 mins.</strong></em></li>\n<li><em><strong>We deliver the products outside the Nehru Place (in Delhi) with in 24 hours, for delivery the products outside Delhi courier charges will be charged.</strong></em></li>\n<li><em><strong>We can change the price of the products at any time without giving any prior information to our buyers, and they are not claim for the same.</strong></em></li>\n<li><em><strong>Oders are subject to deliver only when approved by us other wise they are show ''pending'' status and are not to be considered for the delivery.</strong></em></li>\n<li><em><strong>Orders which show approved status must be delivered with in the time.</strong></em></li>\n<li><em><strong>Buyer can call us any time if found any problem regarding products and information at 011-41704185 and 9899616204.</strong></em></li>\n<li><em><strong>If buyer want to cancel the order then buyer must call or sms us to cancel the same order with order id.</strong></em></li>\n<li><em><strong>Buyer must review his cart before submit his order, once the order submit it assumes to be final order.</strong></em></li>\n<li><em><strong>Buyer must check their mails for the emails sent by us that is "shop@shanmukhaventure.com" and add this mail id in their address book so that to be recieved in their Inbox not in other folders.</strong></em></li>\n<li><em><strong>We can change our terms and condition at any time without any prior notice to any buyer and nobody will claim us in any manner.</strong></em></li>\n</ol>', '2016-06-15 15:54:03', '2017-05-25 11:56:46'),
